export const addAce = (principal, ace, allow) => exports.ox_lib.addAce(principal, ace, allow);
export const removeAce = (principal, ace, allow) => exports.ox_lib.addAce(principal, ace, allow);
export const addPrincipal = (child, parent) => exports.ox_lib.addPrincipal(child, parent);
export const removePrincipal = (child, parent) => exports.ox_lib.removePrincipal(child, parent);
